import React from "react";

import Fade from 'react-reveal/Fade';
import Bounce from 'react-reveal/Bounce';

function Home() {

    var i = 0;
    var txt = 'Hello there, I am Alex a software developer in Melbourne';
    var speed = 50;

    function typeWriter() {
        if (i < txt.length) {
            document.getElementById("welcomeText").innerHTML += txt.charAt(i);
            i++;
            setTimeout(typeWriter, speed);
        }
    }

    typeWriter();

    return (
        <div id="home">
            <div className="container">        
                <Fade>
                <h1 id="welcomeText">

                </h1>
                </Fade>
                <Bounce>
                    <a href="#about">
                        <button>
                            Lets make something great
                        </button>
                    </a>
                </Bounce>
            </div>
        </div>        
    )
}

export default Home;
